DO $$
DECLARE
	company_user_id usr_user.usr_id%TYPE;

	/*	Información del coworking	*/
	my_city city.city%TYPE;
	my_address coworking.cw_address%TYPE;
 	my_name coworking.cw_name%TYPE;
 	my_description coworking.cw_description%TYPE;
	my_capacity coworking.cw_capacity%TYPE;
	my_daily_price coworking.cw_daily_price%TYPE;
	my_lat coworking.cw_lat%TYPE;
	my_lon coworking.cw_lon%TYPE;
	my_cw_image coworking.cw_image%TYPE;
	my_cw_image_resized coworking.cw_image_resized%TYPE;

	my_location coworking.cw_location%TYPE;

	my_cw_id coworking.cw_id%TYPE;

	my_date	TIMESTAMP;

BEGIN
	/*	Asignamos la fecha de partida de los datos actuales	*/
	SELECT CURRENT_DATE - INTERVAL '1 month' INTO my_date;

/*
**
**      Creamos corworking: CoLab Zone - Boiro
**
*/

	/*	Asignamos los valores del coworking que vamos a crear	*/
	SELECT 'Boiro','Rua Bao 5', 'CoLab Zone', 'Espacio compartido ideal para networking y productividad, con ambiente colaborativo y gran cantidad de servicios. ¡Te esperamos!' INTO my_city, my_address, my_name, my_description;

	/*	Recuperamos el código de ciudad para que recupere el valor de la ciudad	*/
  	SELECT id_city INTO my_location FROM city where city =  my_city;

	SELECT 18, 9.9, 42.6473914299921, -8.88461882707949 INTO my_capacity, my_daily_price, my_lat, my_lon coworking;
	SELECT ''
	INTO my_cw_image;

	SELECT ''
	INTO my_cw_image_resized;

	/*	Recuperamos el código de ciudad para que recupere el valor de la ciudad	*/
	SELECT id_city INTO my_location FROM city where city =  my_city;

	/*	Recuperamos el código de usuario para que genere los coworking	*/
	SELECT usr_ID INTO company_user_id FROM usr_user WHERE usr_login = 'company';

	/*	Insertamos un nuevo coworking*/
	INSERT INTO public.coworking (cw_id, cw_name, cw_description, cw_address, cw_capacity, cw_daily_price, cw_usr_id, cw_start_date, cw_end_date, cw_image, cw_location, cw_lat, cw_lon, cw_image_resized)
	values (nextval('coworking_cw_id_seq'::regclass), my_name, my_description, my_address, my_capacity, my_daily_price, company_user_id, my_date, null, my_cw_image, my_location, my_lat, my_lon, my_cw_image_resized)
	RETURNING cw_id INTO my_cw_id;

	/*	Insertamos los servicios del nuevo coworking: 1.- additional_screen | 2.- vending_machine | 3.- coffee_bar | 4.- water_dispenser | 5.- ergonomic_chair | 6.- parking */
	INSERT INTO public.cw_service (cser_id, cw_id, srv_id) VALUES(nextval('cw_service_cser_id_seq'::regclass), my_cw_id, 2);
	INSERT INTO public.cw_service (cser_id, cw_id, srv_id) VALUES(nextval('cw_service_cser_id_seq'::regclass), my_cw_id, 3);
	INSERT INTO public.cw_service (cser_id, cw_id, srv_id) VALUES(nextval('cw_service_cser_id_seq'::regclass), my_cw_id, 4);
	INSERT INTO public.cw_service (cser_id, cw_id, srv_id) VALUES(nextval('cw_service_cser_id_seq'::regclass), my_cw_id, 6);


END $$;
